-- Estrutura para vista `v_ativo_veiculo_manutencao_horimetro`
--
DROP TABLE IF EXISTS `v_ativo_veiculo_manutencao_horimetro`;

CREATE ALGORITHM=UNDEFINED DEFINER=`sgaeng_sistema`@`%` SQL SECURITY DEFINER VIEW `v_ativo_veiculo_manutencao_horimetro`  AS SELECT `c1`.`id_ativo_veiculo` AS `id_ativo_veiculo`, `c1`.`id_interno_maquina` AS `id_interno_maquina`, `c1`.`veiculo` AS `veiculo`, `c1`.`marca` AS `marca`, `c1`.`modelo` AS `modelo`, `c1`.`ano` AS `ano`, `c2`.`veiculo_custo` AS `veiculo_custo`, `c2`.`id_ativo_veiculo_manutencao` AS `id_ativo_veiculo_manutencao`, max(`c2`.`veiculo_horimetro_proxima_revisao`) AS `veiculo_horimetro_proxima_revisao`, max(`c3`.`veiculo_horimetro`) AS `veiculo_horimetro_atual`, (max(`c2`.`veiculo_horimetro_proxima_revisao`) - max(`c3`.`veiculo_horimetro`)) AS `saldo`, `c4`.`operacao_alerta` AS `operacao_alerta` FROM (((`ativo_veiculo` `c1` join `ativo_veiculo_manutencao` `c2` on((`c2`.`id_ativo_veiculo` = `c1`.`id_ativo_veiculo`))) join `ativo_veiculo_operacao` `c3` on((`c3`.`id_ativo_veiculo` = `c1`.`id_ativo_veiculo`))) join `configuracao` `c4` on((`c4`.`id_configuracao` = 1))) WHERE ((`c1`.`tipo_veiculo` = 'maquina') AND ((`c2`.`veiculo_horimetro_proxima_revisao` - `c3`.`veiculo_horimetro`) > 0)) GROUP BY `c2`.`id_ativo_veiculo` ;

